import React from "react";
import data from "../data/card-data";

function MST(){
    return(
        <div>
            <div className= "container">
            <h1 className="problem-heading">Minimum Cost Spanning Tree</h1>
            <p className= "problem-desc">{data[1].description}</p>
            </div>
        </div>
    )
}

export default MST;
